export class Contact {
    public id: string;
    public name: string;
    public email: string;
    public phone: string;
    public imageUrl: string;
    public group: null | Contact[];

    constructor(id: string, name: string, email: string, phone: string, imageUrl: string, group: null) {
      this.id = id;
      this.name = name;
      this.email = email;
      this.phone = phone;
      this.imageUrl = imageUrl;
      this.group = group;
    }
}
